import React from 'react';
import { motion } from 'framer-motion';

const Products = () => {
  const products = [
    {
      category: "CS2 NFA",
      status: "Available",
      statusColor: "text-green-400",
      items: [
        { name: "Premier Ready", price: "‚Ç¨1.04", available: true },
        { name: "Premier Ready 4+ Medals", price: "‚Ç¨1.25", available: true },
        { name: "Premier Ready Inactive", price: "‚Ç¨1.50", available: true },
        { name: "Premier Ready 10+ Medals", price: "‚Ç¨2.00", available: true },
        { name: "Premier Ready Skins", price: "‚Ç¨4.00", available: true }
      ]
    },
    {
      category: "Rust NFA",
      status: "Unavailable",
      statusColor: "text-red-400",
      items: [
        { name: "Rust NFA", price: "‚Ç¨1.50", available: false }
      ]
    },
    {
      category: "Ech0 External",
      status: "Available",
      statusColor: "text-green-400",
      items: [
        { name: "14 days", price: "‚Ç¨6", available: true },
        { name: "30 days", price: "‚Ç¨9", available: true },
        { name: "90 days", price: "‚Ç¨21", available: true }
      ]
    }
  ];

  return (
    <section id="products" className="py-20 px-4 sm:px-6 lg:px-8 relative">
      {/* Background */}
      <div className="absolute inset-0 bg-gradient-to-b from-dark-bg to-darker-bg"></div>
      
      <div className="relative z-10 max-w-7xl mx-auto">
        {/* Section Header */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold mb-6">
            <span className="gradient-text">Premium</span> Products
          </h2>
          <p className="text-xl text-gray-300 max-w-3xl mx-auto">
            Choose from our selection of high-performance gaming solutions designed for competitive players
          </p>
        </motion.div>

        {/* Products Grid */}
        <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
          {products.map((product, index) => (
            <motion.div
              key={product.category}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: index * 0.2 }}
              viewport={{ once: true }}
              className="relative group"
            >
              <div className="bg-card-bg rounded-2xl p-8 border border-border-glow/20 hover:border-neon-purple/50 transition-all duration-300 h-full">
                {/* Category Header */}
                <div className="text-center mb-6">
                  <h3 className="text-2xl font-bold text-white mb-2">{product.category}</h3>
                  <span className={`inline-block px-3 py-1 rounded-full text-sm font-medium ${product.statusColor} bg-opacity-10 ${product.statusColor.replace('text-', 'bg-')}`}>
                    {product.status}
                  </span>
                </div>

                {/* Product Items */}
                <div className="space-y-4">
                  {product.items.map((item, itemIndex) => (
                    <motion.div
                      key={itemIndex}
                      initial={{ opacity: 0, x: -20 }}
                      whileInView={{ opacity: 1, x: 0 }}
                      transition={{ duration: 0.5, delay: itemIndex * 0.1 }}
                      viewport={{ once: true }}
                      className={`flex justify-between items-center p-4 rounded-lg transition-all duration-300 ${
                        item.available 
                          ? 'bg-gradient-to-r from-neon-purple/10 to-neon-blue/10 border border-neon-purple/20 hover:border-neon-purple/40' 
                          : 'bg-gray-800/50 border border-gray-600/30 opacity-60'
                      }`}
                    >
                      <span className={`font-medium ${item.available ? 'text-white' : 'text-gray-400'}`}>
                        {item.name}
                      </span>
                      <span className={`font-bold text-lg ${item.available ? 'text-neon-cyan' : 'text-gray-500'}`}>
                        {item.price}
                      </span>
                    </motion.div>
                  ))}
                </div>

                {/* CTA Button */}
                <motion.button
                  whileHover={{ scale: 1.02 }}
                  whileTap={{ scale: 0.98 }}
                  className={`w-full mt-6 py-3 px-6 rounded-lg font-semibold transition-all duration-300 ${
                    product.status === "Available"
                      ? 'bg-gradient-to-r from-neon-purple to-neon-blue text-white hover:shadow-lg hover:shadow-neon-purple/25'
                      : 'bg-gray-600 text-gray-300 cursor-not-allowed'
                  }`}
                  disabled={product.status === "Unavailable"}
                >
                  {product.status === "Available" ? "Get Started" : "Coming Soon"}
                </motion.button>
              </div>

              {/* Glow effect on hover */}
              <div className="absolute inset-0 rounded-2xl bg-gradient-to-r from-neon-purple/20 to-neon-blue/20 opacity-0 group-hover:opacity-100 transition-opacity duration-300 -z-10 blur-xl"></div>
            </motion.div>
          ))}
        </div>

        {/* Additional Info */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8, delay: 0.6 }}
          viewport={{ once: true }}
          className="text-center mt-16 p-8 bg-gradient-to-r from-neon-purple/10 to-neon-blue/10 rounded-2xl border border-neon-purple/20"
        >
          <h3 className="text-2xl font-bold text-white mb-4">Why Choose Vetra?</h3>
          <div className="grid grid-cols-1 md:grid-cols-3 gap-6 text-gray-300">
            <div>
              <div className="text-neon-cyan text-2xl mb-2">üîí</div>
              <div className="font-semibold">Undetected</div>
              <div className="text-sm">Advanced anti-detection systems</div>
            </div>
            <div>
              <div className="text-neon-purple text-2xl mb-2">‚ö°</div>
              <div className="font-semibold">High Performance</div>
              <div className="text-sm">Optimized for maximum FPS</div>
            </div>
            <div>
              <div className="text-neon-blue text-2xl mb-2">üõ°Ô∏è</div>
              <div className="font-semibold">24/7 Support</div>
              <div className="text-sm">Round-the-clock assistance</div>
            </div>
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Products;
